import React from 'react';
import './App.css';
import {Route} from 'react-router-dom';
import HomePage from './pages/homepage/homepage.component';

function App() {
  return (
    <div>
      <Route exact  path='/home' component={HomePage} />
    </div>
  );
}

export default App;
